import React from 'react'
import Navbar from '../components/Navbar'
import Dashboard from '../components/Dashboard'
import ProjectList from './getProjects'
// import ProjectForm from './ProjectForm'
// import ProjectList from './getProjects'

function Home() {
    return (
        <div>
            <div> <Navbar /> </div>
            <div> <Dashboard/></div>
            <div><ProjectList/></div>
        </div>
    )
}

export default Home
